import React from "react";
import styled from "styled-components";

interface BotButtonProps {
  text: string;
  type?: "primary" | "secondary";
  onClick: () => void;
}

const BotButton: React.FC<BotButtonProps> = ({ text, type = "primary", onClick }) => {
  return (
    <StyledButton type={type} onClick={onClick}>
      {text}
    </StyledButton>
  );
};

const StyledButton = styled.button<{ type: "primary" | "secondary" }>`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 200px;
  height: 72px;
  border-radius: 8px;
  font-size: ${({ theme }) => theme.typography.T4.size};
  font-weight: ${({ theme }) => theme.typography.T4.weight};
  line-height: ${({ theme }) => theme.typography.T4.lineHeight};
  color: ${({ theme, type }) => (type === "primary" ? theme.colors.white : theme.colors.black)};
  background-color: ${({ theme, type }) =>
    type === "primary" ? theme.colors.primary : theme.colors.gray[400]};
  border: none;
  cursor: pointer;

  &:hover {
    opacity: 0.9;
  }

  &:active {
    opacity: 0.8;
  }
`;

export default BotButton;
